import React from 'react'; 
import { StyleSheet } from 'react-native'; 
import { DataTable } from 'react-native-paper'; 
  
const TableExample = () => { 
  return (
    <DataTable style={styles.container}> 
      <DataTable.Header style={styles.tableHeader}> 
        <DataTable.Title>Count</DataTable.Title> 
        <DataTable.Title>Variety</DataTable.Title> 
        <DataTable.Title>Ripeness</DataTable.Title> 
        <DataTable.Title>Date</DataTable.Title> 
        <DataTable.Title>Time</DataTable.Title> 
      </DataTable.Header> 
      
      <DataTable.Row> 
        <DataTable.Cell>1</DataTable.Cell> 
        <DataTable.Cell>Sugar Baby</DataTable.Cell> 
        <DataTable.Cell>Unripe</DataTable.Cell> 
        <DataTable.Cell>March 9, 2024</DataTable.Cell> 
        <DataTable.Cell>03:40</DataTable.Cell> 
      </DataTable.Row> 
  
    </DataTable> 
  ); 
}; 
  
export default TableExample; 
  
const styles = StyleSheet.create({ 
  container: { 
    padding: 15, 
  }, 
  tableHeader: { 
    backgroundColor: '#DCDCDC', 
  }, 
});
